glsl1.vert:
precision highp float;
uniform highp mat4 cc_matView;
  uniform highp mat4 cc_matProj;
  uniform highp mat4 cc_matViewProj;
  uniform highp vec4 cc_cameraPos;
#if USE_LOCAL
  uniform highp mat4 cc_matWorld;
#endif
#if SAMPLE_FROM_RT
  #define QUATER_PI         0.78539816340
  #define HALF_PI           1.57079632679
  #define PI                3.14159265359
  #define PI2               6.28318530718
  #define PI4               12.5663706144
  #define INV_QUATER_PI     1.27323954474
  #define INV_HALF_PI       0.63661977237
  #define INV_PI            0.31830988618
  #define INV_PI2           0.15915494309
  #define INV_PI4           0.07957747155
  #define EPSILON           1e-6
  #define EPSILON_LOWP      1e-4
  #define LOG2              1.442695
  #define EXP_VALUE         2.71828183f
  #define FP_MAX            65504.0
  #define FP_SCALE          0.0009765625
  #define FP_SCALE_INV      1024.0
  #define GRAY_VECTOR       vec3(0.299, 0.587, 0.114)
      #define CC_LIGHTMAP_DISABLED 0
  #define CC_LIGHTMAP_ALL_IN_ONE 1
  #define CC_LIGHTMAP_CC_LIGHTMAP_INDIRECT_OCCLUSION 2
#endif
attribute vec3 a_position;
attribute vec2 a_texCoord;
attribute vec4 a_color;
varying vec4 color;
varying vec2 uv0;
vec4 vert () {
  vec4 pos = vec4(a_position, 1);
  #if USE_LOCAL
    pos = cc_matWorld * pos;
  #endif
  #if USE_PIXEL_ALIGNMENT
    pos = cc_matView * pos;
    pos.xyz = floor(pos.xyz);
    pos = cc_matProj * pos;
  #else
    pos = cc_matViewProj * pos;
  #endif
  uv0 = a_texCoord;
  #if SAMPLE_FROM_RT
    uv0 = cc_cameraPos.w > 1.0 ? vec2(uv0.x, 1.0 - uv0.y) : uv0;
  #endif
  color = a_color;
  return pos;
}
void main() { gl_Position = vert(); }

glsl1.frag:
precision highp float;
vec4 CCSampleWithAlphaSeparated(sampler2D tex, vec2 uv) {
#if CC_USE_EMBEDDED_ALPHA
  return vec4(texture2D(tex, uv).rgb, texture2D(tex, uv + vec2(0.0, 0.5)).r);
#else
  return texture2D(tex, uv);
#endif
}
#if USE_ALPHA_TEST
      uniform float alphaThreshold;
#endif
void ALPHA_TEST (in vec4 color) {
  #if USE_ALPHA_TEST
    if (color.a < alphaThreshold) discard;
  #endif
}
void ALPHA_TEST (in float alpha) {
  #if USE_ALPHA_TEST
    if (alpha < alphaThreshold) discard;
  #endif
}
varying vec4 color;
   uniform vec4 startColor;
   uniform vec4 endColor;
#if USE_TEXTURE
  varying vec2 uv0;
  uniform sampler2D cc_spriteTexture;
#endif
vec4 frag () {
  vec4 o = vec4(1, 1, 1, 1);
  #if USE_TEXTURE
    o *= CCSampleWithAlphaSeparated(cc_spriteTexture, uv0);
    #if IS_GRAY
      float gray  = 0.2126 * o.r + 0.7152 * o.g + 0.0722 * o.b;
      o.r = o.g = o.b = gray;
    #endif
    #if USE_HORIZONTAL
       o.rgb *= mix(startColor, endColor, vec4(uv0.x)).rgb;
    #endif
    #if USE_VERTICAL
       o.rgb *= mix(startColor, endColor, vec4(uv0.y)).rgb;
    #endif
  #endif
  o *= color;
  ALPHA_TEST(o);
  return o;
}
void main() { gl_FragColor = frag(); }
